import React from 'react'
import { v4 as uuidv4 } from 'uuid';

// importing images:
// import coffeeImg from '../img/art/coffee.jpg'
// import buildingImg from '../img/art/building.jpg'

const ArtItems = [
  {title: "building", description: "", image: '../img/art/coffee.jpg'},
  {title: "coffee", description: "", image: '../img/art/building.jpg'}
  // {title: "More", description: "", image: ArtDirectory + "fallentree.jpg"}
]

const Art = () => {
  return (
    <div>
      <img src={require('../img/art/fallentree.jpg')} alt="nope"/>
      {ArtItems.map((artItem, i) => {
        return <img 
          key={uuidv4()}
          src={require(artItem.image)}
          alt={artItem.title}
          />
      })}
    </div>
  )
}

export default Art
